const INITIAL_STATE = {
  possible: [
    'Allie',
    'Gator',
    'Lizzie',
    'Reptar',
  ],
};

const wordsReducer = (state = INITIAL_STATE, action:any) => {
  switch (action.type) {
    default:
      return state
  }
};

export default wordsReducer;
